import React from "react";

function Board(props){

  let printBoard = props.solvedBoard.map((cell, index) => {
    return (
      <div key={index}>{cell} </div>
    )
  })
  return(
    <>
     {printBoard}
     <button onClick={() => {console.log(props.solvedBoard)}}>click</button>
    </>
  );
}
export default Board;
